import React from 'react';

var loadedImages = 0;

function singleImage(img) {
    let image = new Image();
    image.src = img;
    image.onload = function() {
        loadedImages++;
        console.log(loadedImages);
    }
    return image;
}

export default class LoadBar extends React.Component {
    render() {
        return(

            <h1>Hey Im Loading</h1>

        )
    }
}

export {singleImage}
